For now using `.view` to implement:

```python
class Reduction(nn.Module):
    def __init__(self, operation='+', axis=None):
        super(Reduction, self).__init__()
        self.operation = operation
        self.axis = axis or 0  # default initial axis to reduce

    def extra_repr(self):
        """Extra information
        """
        return "{}{}".format(
                self.operation,
                ", axis={}".format(self.axis) if self.axis else "",
        )

    def forward(self, x):
        axis = self.axis
        if self.axis == 0 and x.size(0) == 1:
            # full reduction on a single batch
            axis = None
            dims = None
        else:
            # TODO: use .flatten(axis) instead of .view(*dims) when ONNX supports flatten
            dims = [x.shape[ii] for ii in range(axis)] + [-1]
        if self.operation == '+' or self.operation == 'SUM':
            if axis is None:
                return x.sum()
            return x.view(*dims).sum(axis)
        elif self.operation == 'ASUM':
            if axis is None:
                return x.abs().sum()
            return x.abs().view(*dims).sum(axis)
        elif self.operation == 'SUMSQ':
            if axis is None:
                return x.pow(2).sum()
            return x.pow(2).view(*dims).sum(axis)
        elif self.operation == 'MEAN':
            if axis is None:
                return x.mean()
            return x.view(*dims).mean(axis)
        else:
            raise RuntimeError('forward Reduction, unknown operator: {}'.format(self.operation))
